column8:
●顔にスプレーするだけで、ウイルスが侵入しやすい鼻や口をしっかりガードします。<br>
●天然潤水成分「ヒアルロン酸Na」を配合しています。<br>
●気軽に使えて手も汚れないスプレータイプ。メイクの上から使え、化粧崩れの心配もありません。<br>
●空気中に漂う微小粒子状物質（PM2.5など）の吸入も抑えます。<br>
●医薬品ではないので安心して使用でき、他の医薬品と併用することもできます。<br><br>

【使用方法】<br>
軽く振ってからご使用ください。顔に対して20cm程度離し、適量(2プッシュ)を全体に広がるようスプレーしてください。<br>
●メイクをしている場合、メイクの上からご使用ください。<br>
●スプレー後、液が気になる場合は手で軽くおさえ、肌になじませてください。<br>
●目に入らないよう、目を閉じて使用してください。<br>
●衣類にかからないよう注意してください。<br>
※使い始めは、液が出るまで数回カラ押しを行ってください。<br><br>

【ご注意】<br>
○定められた使用方法を守る。<br>
○飲めません。<br>
○傷、はれもの、湿疹、かぶれ等、肌に異常のある時は使用しない。<br>
○使用中に発疹・発赤・かゆみ・刺激等の異常を感じた場合は、使用を中止し、医師に相談する。<br>
○目に入らないよう注意し、入った場合は水でよく洗い流す。<br>
○衣類に付着した場合、白くなることがあります。<br>
○小児の手の届かない所に保管する。<br>
○直射日光の当たる場所、高温となる場所をさけ、涼しい場所に保管する。<br>
○他の容器に入れ替えて使用しない。誤用の原因になったり品質が変わるおそれがあります。<br>
○使用後はキャップを閉める。<br><br>

【成分】<br>
陽電荷ポリマー、酸化チタン分散体、ヒアルロン酸ナトリウム、水、エタノール、パラベン<br><br>

【内容量】<br>
50ml<br><br>

【販売元】<br>
フマキラー株式会社<br>
お客様相談室：03-3255-6400<br><br>

【商品区分】<br>
衛生医療<br><br>

［アレルシャット/ウイルス対策/イオンのマスク］

<br><br><br><hr>
広告文責：株式会社モリキ<br>
